  /// saveAll method saves the sent List<Ticket> as a bulk in one transaction
  /// Returns a <List<BoolResult>>
  static Future<List<dynamic>> saveAll(List<Ticket> tickets,
      {bool? exclusive, bool? noResult, bool? continueOnError}) async {
    List<dynamic>? result = [];
    // If there is no open transaction, start one
    final isStartedBatch = await MovieDB().batchStart();
    for (final obj in tickets) {
      await obj.save(ignoreBatch: false);
    }
    if (!isStartedBatch) {
      result = await MovieDB().batchCommit(
          exclusive: exclusive,
          noResult: noResult,
          continueOnError: continueOnError);
    }
    return result!;
  }

