  Future<int?> upsert({bool ignoreBatch = true}) async {
    try {
      final result = await _mnTicket.rawInsert(
          'INSERT OR REPLACE INTO ticket (ticketID, movieID, customerName, email, customerID, contactNumber, movieTitle, url, movieStartTime, movieEndTime)  VALUES (?,?,?,?,?,?,?,?,?,?)',
          [
            ticketID,
            movieID,
            customerName,
            email,
            customerID,
            contactNumber,
            movieTitle,
            url,
            movieStartTime,
            movieEndTime
          ],
          ignoreBatch);
      if (result! > 0) {
        saveResult = BoolResult(
            success: true,
            successMessage: 'Ticket ticketID=$ticketID updated successfully');
      } else {
        saveResult = BoolResult(
            success: false,
            errorMessage: 'Ticket ticketID=$ticketID did not update');
      }
      return ticketID;
    } catch (e) {
      saveResult = BoolResult(
          success: false,
          errorMessage: 'Ticket Save failed. Error: ${e.toString()}');
      return null;
    }
  }

