  /// saveAll method saves the sent List<History> as a bulk in one transaction
  /// Returns a <List<BoolResult>>
  static Future<List<dynamic>> saveAll(List<History> histories,
      {bool? exclusive, bool? noResult, bool? continueOnError}) async {
    List<dynamic>? result = [];
    // If there is no open transaction, start one
    final isStartedBatch = await MovieDB().batchStart();
    for (final obj in histories) {
      await obj.save(ignoreBatch: false);
    }
    if (!isStartedBatch) {
      result = await MovieDB().batchCommit(
          exclusive: exclusive,
          noResult: noResult,
          continueOnError: continueOnError);
    }
    return result!;
  }

  /// Updates if the record exists, otherwise adds a new row
  /// <returns>Returns movieID
  @override
  Future<int?> upsert({bool ignoreBatch = true}) async {
    try {
      final result = await _mnHistory.rawInsert(
          'INSERT OR REPLACE INTO history (movieID, url, searchAt, title)  VALUES (?,?,?,?)',
          [movieID, url, searchAt, title],
          ignoreBatch);
      if (result! > 0) {
        saveResult = BoolResult(
            success: true,
            successMessage: 'History movieID=$movieID updated successfully');
      } else {
        saveResult = BoolResult(
            success: false,
            errorMessage: 'History movieID=$movieID did not update');
      }
      return movieID;
    } catch (e) {
      saveResult = BoolResult(
          success: false,
          errorMessage: 'History Save failed. Error: ${e.toString()}');
      return null;
    }
  }

